import React, { Component } from "react";
import MaterialTable from "material-table";

class StudentsList extends Component {
	constructor(props) {
		super(props);
		this.state = {
			data: {
				students: [
					{
						name: "Rchel",
						course: "MBA",
						year: 1,
						branch: "CSE",
						className: "CSE 2A",
						id: 1
					}
				]
			}
		};
	}

	columns = [
		{ title: "Name", field: "name" },
		{
			title: "Course",
			field: "course"
		},
		{
			title: "Year",
			field: "year",
			type: "numeric"
		},
		{
			title: "Branch",
			field: "branch"
		},
		{
			title: "Class Name",
			field: "className"
		},

		{
			title: "Id",
			field: "id",
			hidden: true
		}
	];
	actions = [
		{
			icon: "visibility",
			tooltip: "View Student Report ",
			onClick: (event, rowData) => {
				console.log(rowData);
			}
		}
	];

	render() {
		return (
			<MaterialTable
				columns={this.columns}
				data={this.state.data.Questions}
				options={{
					filtering: true,
					actionsColumnIndex: -1
				}}
				actions={this.actions}
				title="Students List"
			/>
		);
	}
}

export default StudentsList;
